import React, { useState, useEffect } from "react";
import FacultySidebar from "./FacultySidebar";
import FacultyHeader from "./FacultyHeader";

import ResearchPapers from "./ResearchPapers";
import StartupActivities from "./StartupActivities";
import Publications from "./Publications";
import GrantsFunding from "./GrantsFunding";
import SIH from "./SIH";
import MSME from "./MSME";
import RecognitionAwards from "./RecognitionAwards";
import Chatbot from "./Chatbot";

import axios from "axios";
import { Bar, Pie } from "react-chartjs-2";
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  ArcElement,
  Tooltip,
  Legend
} from "chart.js";

import "./StudentDashboard.css"; // ✅ reuse same CSS

import ViewCertificates from "./ViewCertificates";

ChartJS.register(
  CategoryScale,
  LinearScale,
  BarElement,
  ArcElement,
  Tooltip,
  Legend
);

export default function FacultyDashboard() {
  const [activeSection, setActiveSection] = useState("dashboard");
  const [analytics, setAnalytics] = useState(null);
  const facultyId = localStorage.getItem("facultyId");
  useEffect(() => {
    const fetchAnalytics = async () => {
      try {
        const res = await axios.get("/api/faculty/dashboard/metrics");
        setAnalytics(res.data);
      } catch {
        console.error("Failed to load faculty analytics");
      }
    };

    fetchAnalytics();
  }, []);

  const barData = analytics && {
    labels: [
      "Research",
      "Startups",
      "Publications",
      "SIH",
      "MSME",
      "Awards"
    ],
    datasets: [
      {
        label: "Faculty Contributions",
        data: [
          analytics.research,
          analytics.startups,
          analytics.publications,
          analytics.sih,
          analytics.msme,
          analytics.awards
        ],
        backgroundColor: "#1d4ed8"
      }
    ]
  };

  const pieData = analytics && {
    labels: ["Research", "Startups", "Publications"],
    datasets: [
      {
        data: [
          analytics.research,
          analytics.startups,
          analytics.publications
        ],
        backgroundColor: ["#2563eb", "#22c55e", "#f97316"]
      }
    ]
  };

  return (
    <div className="dashboard-wrapper">
      <FacultySidebar
        activeSection={activeSection}
        setActiveSection={setActiveSection}
      />

      <div className="dashboard-main">
        {/* ✅ FACULTY HEADER ONLY */}
        <FacultyHeader />

        <div className="dashboard-content">
          {activeSection === "dashboard" && analytics && (
            <>
              <h3>Your Faculty Metrics</h3>

              <div className="metrics-grid">
                <div className="metric-box">
                  <h4>Research Papers</h4>
                  <p>{analytics.research}</p>
                </div>

                <div className="metric-box">
                  <h4>Publications</h4>
                  <p>{analytics.publications}</p>
                </div>

                <div className="metric-box">
                  <h4>Startups</h4>
                  <p>{analytics.startups}</p>
                </div>

                <div className="metric-box">
                  <h4>SIH Participations</h4>
                  <p>{analytics.sih}</p>
                </div>
              </div>

              <div className="charts-grid">
                <div className="chart-box">
                  <h4>Overall Contributions</h4>
                  <Bar data={barData} />
                </div>

                <div className="chart-box">
                  <h4>Contribution Split</h4>
                  <Pie data={pieData} />
                </div>
              </div>
            </>
          )}

          {activeSection === "researchPapers" && <ResearchPapers />}
          {activeSection === "startup" && <StartupActivities />}
          {activeSection === "publications" && <Publications />}
          {activeSection === "grants" && <GrantsFunding />}
          {activeSection === "sih" && <SIH />}
          {activeSection === "msme" && <MSME />}
          {activeSection === "recognition" && <RecognitionAwards />}
       {/* ✅ CERTIFICATES */}
          {activeSection === "certificates" && facultyId && (
            <ViewCertificates
              role="faculty"
              userId={facultyId}
            />
          )}


        </div>

        {/* Optional chatbot */}
        <Chatbot />
      </div>
    </div>
  );
}
